import { Link } from "react-router-dom";
import "./Navbar.css"

function Navbar() {
  return (
    <nav className="Navbar">
        <button>Home</button>

      <button>Logout</button>

      <Link to="/signup">
        <button>Sign Up</button>
      </Link>

      <Link to="/login">
        <button>Login</button>
      </Link>

      <div className="profile-img-wrapper">
      </div>
    </nav>
  );
}

export default Navbar;
